BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "User" (
	"user_id"	TEXT,
	"username"	TEXT,
	"password"	TEXT,
	"email"	TEXT,
	"date_of_birth"	TEXT,
	"gender"	TEXT,
	PRIMARY KEY("user_id")
);
CREATE TABLE IF NOT EXISTS "Health_Record" (
	"record_id"	INTEGER,
	"user_id"	INTEGER,
	"date"	TEXT,
	"height"	INTEGER,
	"weight"	INTEGER,
	"blood_pressure"	TEXT,
	"notes"	TEXT,
	PRIMARY KEY("record_id"),
	FOREIGN KEY("user_id") REFERENCES "User"("user_id")
);
CREATE TABLE IF NOT EXISTS "Activity" (
	"activity_id"	INTEGER,
	"user_id"	TEXT,
	"activity_type"	TEXT,
	"duration"	INTEGER,
	"intensity"	TEXT,
	"calories_burned"	INTEGER,
	"field7"	TEXT,
	PRIMARY KEY("activity_id"),
	FOREIGN KEY("user_id") REFERENCES "User"("user_id")
);
CREATE TABLE IF NOT EXISTS "Goal" (
	"goal_id"	INTEGER,
	"user_id"	INTEGER,
	"goal_type"	TEXT,
	"target_value"	INTEGER,
	"start_date"	TEXT,
	"end_date"	TEXT,
	"field7"	TEXT,
	PRIMARY KEY("goal_id"),
	FOREIGN KEY("user_id") REFERENCES "User"("user_id")
);
CREATE TABLE IF NOT EXISTS "Diet" (
	"diet_id"	TEXT,
	"user_id"	INTEGER,
	"date"	TEXT,
	"meal_type"	TEXT,
	"food_item"	TEXT,
	"calories"	INTEGER,
	PRIMARY KEY("diet_id"),
	FOREIGN KEY("user_id") REFERENCES "User"("user_id")
);
CREATE TABLE IF NOT EXISTS "Medication_Reminder" (
	"reminder_id"	INTEGER,
	"user_id"	INTEGER,
	"medication_name"	TEXT,
	"frequency"	INTEGER,
	"notes"	TEXT,
	PRIMARY KEY("reminder_id"),
	FOREIGN KEY("user_id") REFERENCES "User"("user_id")
);
COMMIT;
